<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;1,500&display=swap" rel="stylesheet">
</head>
<style>

    header{
        display: flex;
        flex-flow: column;
        align-items: center;
        font-family: 'Roboto', sans-serif;
    }

    table{
      width: 100%;
      border-spacing: 0px;
      border: 0.1px solid rgba(0, 0, 0, 0.4);
    }

    table thead tr th,
    table tbody tr td{
      padding: 10px;
      text-align: center;
      font-family: 'Roboto', sans-serif;
      margin: 0px;
      border: 0.1px solid rgba(0, 0, 0, 0.4);
    }

    table tbody tr td{
      font-weight: bold;
    }

    #confidencial{
      font-weight: bold;
      font-family: 'Roboto', sans-serif;
      margin-top: 30px;
      padding: 0px 20px;
      color: red;
    }

</style>
<body>
    
    <main class="px-5">
        <header>
            <img width="200" src='data:image/png;base64,'/>
            <h2>El usuario de SU TALENTO CR se ha sido eliminado</h2>
        </header>

          <div class="" id="confidencial">
            AVISO DE CONFIDENCIALIDAD: La información contenida en este mensaje electrónico, es confidencial y está dirigido al uso de la(s) persona (s) nombrada(s) anteriormente. Si usted no es el destinatario indicado, queda notificado que cualquier divulgación, distribución o copia de este mensaje está estrictamente prohibida. Si usted ha recibido este mensaje por error, favor notifique al remitente y elimínelo inmediatamente.
          </div>

    </main>

</body>
</html>